import React from 'react'
import { Card, CardActions, CardContent, CardMedia, Button, Typography } from "@material-ui/core";

const main = ({ news }) => {
    if(!news) return "Loading...";
    console.log(news.map(item => item.title))
    return (
        <div>
        {news.map((item) => {
                <div>
                    <h1>{item.title}</h1>
                    </div>
        })}
        </div>
    )
}

export default main
